INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 60005, 0, 1, 0, 0, "", 0, 588, 3, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は中吉！　争いごとは勝つが油断は大敵！　　　　　　ま、このあたしと一緒なら、向かうところ敵はねーですよっ！", 60005, 0, 2, 0, 0, "", 0, 589, 3, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は中吉！　ラッキーアイテムは「光るもの」！　　　　ハツネちゃんの「きらーんっ☆」な魔法、見せちゃおうかなっ？", 60005, 0, 2, 0, 0, "", 0, 590, 3, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は小吉！　のんびり穏やかな一日となるでしょう！　　あなた様を邪魔するものは全てエリコが排除しますわ、クスクス♪", 60005, 0, 1, 0, 0, "", 0, 591, 4, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は小吉！　小さな勇気で踏み出す一歩が大事！\n遠くから見てるだけじゃダメ。今日は、少しだけ近づいてみます！", 60005, 0, 1, 0, 0, "", 0, 592, 4, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 60005, 0, 1, 0, 0, "", 0, 593, 4, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 60005, 0, 1, 0, 0, "", 0, 594, 4, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 60005, 0, 1, 0, 0, "", 0, 595, 4, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は小吉！　空を眺めると気持ちが晴れやかに！　　　　眺めるだけじゃなくて、ひとっ飛びしちゃいましょうかっ♪", 60005, 0, 2, 0, 0, "", 0, 596, 4, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は小吉！　掃除をすると運勢が開けそう！　　　　　　「わ、めんど」「ヴルムっ！　新年早々サボっちゃダメなんだからね！」", 60005, 0, 2, 0, 0, "", 0, 597, 4, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 60005, 2, 0, 0, 190804, "カリン", 0, 598, 0, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 60005, 3, 0, 0, 190804, "カリン", 7, 599, 0, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 60006, 1, 1, 0, 190804, "カリン", 0, 600, 0, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は姫吉！　勇気を持って、新しいことに挑戦しよう！\n幸先がいいねえ少年！　今年もいい一年になるよう祈ってるよ。", 60006, 0, 2, 0, 0, "", 0, 601, 1, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は姫吉！　どんなピンチも簡単に乗り越えられそう！\nよい結果が出たようで何よりです。さて、待人の方は……ふふ。", 60006, 0, 2, 0, 0, "", 0, 602, 1, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は姫吉！　あの人と仲直り……できちゃうかも！？\nはあ……この私があなたの運勢に興味を抱くわけないでしょう？", 60006, 0, 2, 0, 0, "", 0, 603, 1, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は大吉！　身近な友達との絆が深まる予感……？\n騎士様は、どなたと友誼を結ぶのでしょう？　気になります……", 60006, 0, 1, 0, 0, "", 0, 604, 2, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は大吉！　ラッキーアイテムは「蛇の抜け殻」！\nこのアタシにお目にかかれるなんて……アンタ、幸せものね♪", 60006, 0, 2, 0, 0, "", 0, 605, 2, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は中吉！　気になるあの人に会えちゃうかも！？\n『初夢を正夢にする枕』であなたに会え……な、なんでもない！", 60006, 0, 2, 0, 0, "", 0, 606, 3, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は中吉！　子供に戻って、一日中遊びつくそう！\nお年玉でけん玉ゲット！　おじちゃん、もしかめ一万回やって！", 60006, 0, 2, 0, 0, "", 0, 607, 3, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は中吉！　今日はおうちで、ゆーっくりくつろごう。\nお雑煮よし。みかんよし。さ、こたつで寝正月だ。君も入る？", 60006, 0, 1, 0, 0, "", 0, 608, 3, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は小吉！　突然のドッキリに注意！\nおや、後ろに髪の長い女の霊が──フフ、冗談です。私ですよ。", 60006, 0, 2, 0, 0, "", 0, 609, 4, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (2, "今日の運勢は小吉。慌てなくても、幸運はきっとやってくる。\n運は自分で掴むもの──媛が言ってました。でも、どうやって？", 60006, 0, 2, 0, 0, "", 0, 610, 4, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (3, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 60006, 2, 0, 0, 190804, "カリン", 0, 611, 0, "");
INSERT INTO `v1_d4f377f387234a3db63cc8e6a5bb2373c8252c5081c1166ce74ad085bd1d0015` VALUES (3, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 60006, 3, 0, 0, 190804, "カリン", 5, 612, 0, "");
